import { useState } from "react";
import SearchBar from "./SearchBar";

export default function Front() {
  const [searchBar, setSearchBar] = useState(false);

  return (
    <section className="z-50 relative">
      <div className="sm:w-11/12 mx-auto">
        <div
          className="relative py-8 sm:rounded-3xl w-full h-[620px] bg-homefrontbg bg-cover lg:bg-center bg-no-repeat bg-left"
        >
          {/* Floating text - directly over the image */}
          <div 
            className="absolute top-20 left-10 text-[30px] font-bold p-4"
            style={{ color: 'yellow', backgroundColor: 'rgba(0, 0, 0, 0.5)', zIndex: 1000 }}
          >
            This is the Floating Text!
          </div>
  
          {/* Other elements */}
          <div className="absolute bottom-[24%] sm:left-[6%] left-[5%] flex items-center flex-wrap gap-4 z-10">
            {/* Search bar or other content */}
          </div>
        </div>
      </div>
    </section>
  );
      
}
